import React from 'react'
const LogiForm =()=>{
    return (
        <form action="">
            <input type="text" placeholder='name'/>
            <input type="text" placeholder='firstname'/>
            <input type="text"/>
        </form>
    )
}
const Loginpage = (props)=>{
    return <div>
        <h1>LOGIN</h1>
    </div>
}
export default Loginpage
